商品名：NSファーファ　ファーファトリップスコットランド 本体 720ml<br>内容量：720ml<br>ブランド：ファーファ<br>原産国：日本<br><br>たっぷり使える柔軟剤。スコットランドの香り。<br>たっぷり使える家族向けの柔軟剤。スコットランドをイメージして作られた、フローラルソープの香り。抗菌・防臭、消臭成分ｉｎで部屋干しＯＫ。<br>使用方法：全自動洗濯機の場合　柔軟仕上げ剤の自動投入口に本品を入れ洗濯します。　　　　　　二槽式・手洗いの場合　すすぎの水がきれいになったら本品を入れ約3分まわすか、ひたした後、脱水します<br>問合せ先：ＮＳファーファジャパン株式会社　〒１３０－００２４東京都墨田区菊川３ー２１ー８お客様相談室　でんわ０３ー５６６９ー１２３０<br><br>JANコード:4902135328270<br><br><br>商品番号：101-16648<br><br><br><br>区分: 洗剤・柔軟剤 <br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
